import { useState } from 'react';
import { Link } from 'react-router-dom';
import cart from '../../Assets/cart-icon.svg';
import logo from '../../Assets/logo.png';
import './Navbar.css';
export const Navbar: React.FC = () => {
  const [page, setPage] = useState<string>('home');
  const onClickPage = (currPage: string) => {
    return setPage(currPage);
  }
  const setHrTag = (currPage: string) => {
    console.log(page, currPage)
    if (page === currPage) {
        return <hr/>;
    }
    return null;
  }

  return (

    <div className="flex justify-around shadow-sm">
        <div className = 'navbar-logo'>
            <img src = {logo} alt = ""/>
            <p className = 'navbar-shop-name'>East End</p>
            <p className = 'navbar-shop-name-trade-mark'>TM</p>
        </div>
        <ul className = "navbar-section">
            <li onClick ={ () => onClickPage('home')}><Link to ="/" className = "navbar-link-tag">Home</Link>{setHrTag("home")}</li>
            <li onClick = { () => onClickPage('coffee')}> <Link to = "/coffee" className = "navbar-link-tag">Coffee</Link>{setHrTag("coffee")} </li>
            <li onClick = { () => onClickPage('dessert')} > <Link to = "/dessert" className = "navbar-link-tag">Dessert</Link>{setHrTag("dessert")} </li>
            <li onClick = { () => onClickPage('merch')} > <Link to = "/merch" className = "navbar-link-tag">Merch</Link>{setHrTag("merch")} </li>
        </ul>
        <div className='navbar-login'>
            <Link to ='/login'><button>Login</button></Link>
            <Link to ='/cart'><img src = {cart} alt = ""/></Link>
            <div className = "navbar-cart-count">0</div>
        </div>
    </div>
  )
}
